import React from 'react'
import { connect } from 'react-redux'
import Nav from './Nav'

function Leaderboard() {
    return(
        <div>
            <Nav />
            Leaderboard
        </div>
    )
}

function mapStateToProps({ users }) {
    return {
        leaders: users.sort((a,b,) => tweets[b].timestamp - tweets[a].timestamp)
    }
}

export default connect()(Leaderboard)
